import axios from "axios";
import { useEffect, useState } from "react";

function UserCrud() {

const [Id, setId] = useState("");
const [Name, setName] = useState("");
const [LastName, setLastName] = useState("");
const [Users, setUsers] = useState([]);
 
  useEffect(() => {
    (async () => await Load())();
  }, []);
 
  async function Load() {
    
    const result = await axios.get("https://localhost:7228/api/User/GetUser");
    setUsers(result.data);
    console.log(result.data);
  }
 
  async function save(event) {
   
    event.preventDefault();
    try {
      await axios.post("https://localhost:7228/api/User/AddUser", {
        
        Name: Name,
        LastName: LastName,
       
      });
      alert("User Registation Successfully");
          setId("");
          setName("");
          setLastName("");
       
     
      Load();
    } catch (err) {
      alert(err);
    }
  }

  async function editUser(Users) {
    setName(Users.Name);
    setLastName(Users.LastName);
   
 
    setId(Users.Id);
  }
 

  async function DeleteUser(Id) {
  await axios.delete("https://localhost:7228/api/User/DeleteUser/" + Id);
   alert("User deleted Successfully");
   setId("");
   setName("");
   setLastName("");
   Load();
  }
 

  async function update(event) {
    event.preventDefault();
    try {

  await axios.patch("https://localhost:7228/api/User/UpdateUser/"+ Users.find((u) => u.Id === Id).Id || Id,
        {
        Id: Id,
        Name: Name,
        LastName: LastName,

        }
      );
      alert("Registation Updateddddd");
      setId("");
      setName("");
      setLastName("");
     
      Load();
    } catch (err) {
      alert(err);
    }
  }

    return (
      <div>
        <h1>User Details</h1>
      <div class="container mt-4">
        <form>
          <div class="form-group">
           
            <input
              type="text"
              class="form-control"
              id="Id"
              hidden
              value={Id}
              onChange={(event) => {
                setId(event.target.value);
              }}
            />

            <label>Name</label>
            <input
              type="text"
              class="form-control"
              id="Name"
              value={Name}
              onChange={(event) => {
                setName(event.target.value);
              }}
            />
          </div>
          <div class="form-group">
            <label>Course</label>
            <input
              type="text"
              class="form-control"
              id="LastName"
              value={LastName}
              onChange={(event) => {
                setLastName(event.target.value);
              }}
            />
          </div>
          <div>
            <button class="btn btn-primary mt-4" onClick={save}>
              Register
            </button>
            <button class="btn btn-warning mt-4" onClick={update}>
              Update
            </button>
          </div>
        </form>
      </div>
      <br></br>

      <table class="table table-dark" align="center">
        <thead>
          <tr>
            <th scope="col">Id</th>
            <th scope="col">Name</th>
            <th scope="col">Course</th>
         
 
            <th scope="col">Option</th>
          </tr>
        </thead>
        {Users.map(function fn(User) {
          return (
            <tbody>
              <tr>
                <th scope="row">{User.Id} </th>
                <td>{User.Name}</td>
                <td>{User.LastName}</td>
                
                <td>
                  <button
                    type="button"
                    class="btn btn-warning"
                    onClick={() => editUser(User)}
                  >
                    Edit
                  </button>
                  <button
                    type="button"
                    class="btn btn-danger"
                    onClick={() => DeleteUser(User.Id)}
                  >
                    Delete
                  </button>
                </td>
              </tr>
            </tbody>
          );
        })}
      </table>
        
      </div>
    );
  }
  
  export default UserCrud;
